Danish midfielder Daniel Wass gave an interview this Wednesday at the A Madroa press room, a day after the Danish national team, of which Celta teammate Sisto is now member, achieved its qualification for the 2018 World Cup: “I’m very happy for my country. I want to play again for my national team”, Wass said, who has not been called up to his national squad recently despite his great performance at RC Celta.

The footballer from Gladsaxe focused his words on the league match against Sevilla (Sunday 18:30 GMT+1, Sánchez Pizjuán). The Vigo team will meet up again with familiar faces: Krohn-Dehli, Nolito and Berizzo. Wass acknowledged that it “is a special match for us and for them” and, in sports terms, he highlighted that Celta “is good at playing big games”.

On top of that, the match against the Andalusian squad has an extra incentive for Daniel Wass, since 6 Danish players (Krohn-Dehli y Kjaer on behalf of Sevilla; Sisto, Hjulsager, Mor and Wass himself on behalf of Celta) might be on the pitch, alongside a seventh Scandinavian, John Guidetti: “it is going to be a very special match for the Nordics”, Wass stated.
